SELECT ?name
WHERE {
{?game <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Video_games> .
?game foaf:name ?name .}
UNION
{?game <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Party_games> .}
}
ORDER by ?name
