SELECT ?name ?abstract ?game
WHERE {
?name <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Party_games> .
?game foaf:name ?name.
OPTIONAL
{FILTER langMatches( lang(?abstract), 'en')}
OPTIONAL
{FILTER langMatches( lang(?abstract), 'pl')}
}
ORDER by ?name
limit 10

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?name ?game ?opis_en ?opis_pl
WHERE {
?game <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Party_games> .
?game foaf:name ?name .
OPTIONAL {
?game rdfs:comment ?opis_en .
FILTER (lang(?opis_en) = 'en') .
}
OPTIONAL {
?game rdfs:comment ?opis_pl .
FILTER (lang(?opis_pl) = 'pl') .
}
}
ORDER BY ?name
limit 10

SELECT ?name ?game ?opis_en ?opis_pl
